import React from "react"
import { Player } from 'video-react';


function Vplayer () {
  return (
    <>
        <Player
          id="playerId"
          playsInline
          fluid={false}
          autoPlay
          controls={false}
          loop
          style={{display: 'none'}}
          src="videos/01.mp4"
        />
    </>
  )
}

export default Vplayer
